export const getCategoryProducts = async (req: Request, res: Response) => {
    try {
        const getProductsByCategoryId = (categoryId: string) => {
            const filteredProducts = categoriesProducts.filter(
                (product) => product.categoryId === categoryId
            );
            return filteredProducts;
        };

        const productsForCategory = getProductsByCategoryId(req.body.categoryId);

        res.send(productsForCategory)
    } catch (error) {
        console.log(error);
    }
}